riga = ''


def solve(riga):
    line = riga
    for i in range(len(line) - 1, 0, -1):
        a, b = line[i], line[i - 1]
        if a != b and a.lower() == b.lower():
            if i == len(line) - 1:
                line = ' ' + line[:i - 1]
            else:
                line = line[:i - 1] + line[i + 1:]
    return (len(line.strip()), ''.join(line))


part1 = solve(riga)
print(part1)


def solve2(riga):
    char = set(riga.lower())
    combination = min(solve(riga.replace(ch, '').replace(ch.upper(), '')) for ch in char)
    return combination


part2 = solve2(riga)
print(part2)
